svg.script:

(function() {
  try {
    var turb = document.getElementById('turb');
    var disp = document.getElementById('disp');
    function glitch() {
      turb.setAttribute('seed', Math.floor(Math.random() * 1000));
      turb.setAttribute('baseFrequency', '0.002 ' + (0.05 + (Math.random() * 0.35)));
      disp.setAttribute('scale', 50 + (Math.random() * 300));
    }

    glitch();
    document.documentElement.addEventListener('click', glitch);
    document.documentElement.addEventListener('dblclick', function() { disp.setAttribute('scale', 0); });
  } catch(e) {}
})();
